import React from "react";
//import myImage from "../img/myImage.png";

class About extends React.Component {
  constructor() {
    super();
    this.state = {
      skills: [
        { id: "HTML5_skill", content: "PYTHON", porcentage: "90%", value: "90" },
        { id: "CSS3_skill", content: "JAVA", porcentage: "90%", value: "90" },
        {
          id: "JavaScript_skill",
          content: "JavaScript",
          porcentage: "90%",
          value: "90"
        },
        { id: "PHP_skill", content: "HTML/CSS3", porcentage: "90%", value: "90" },
        {
          id: "ReactJS_skill",
          content: "ReactJS",
          porcentage: "80%",
          value: "80"
        },
        {
          id: "Python_skill",
          content: "Machine Learning",
          porcentage: "70%",
          value: "70"
        },
        {
          id: "VanillaJS_skill",
          content: "Artificial Intelligence",
          porcentage: "75%",
          value: "75"
        },
        {
          id: "Wordpress_skill",
          content: "Databases: MongoDB, MySQL, PostgreSQL",
          porcentage: "80%",
          value: "80"
        }
      ],
      about_me: [
        {
          id: "first-p-about",
          content:
            "Hello! I'm Mehul Jaiswal, a passionate and dedicated computer science enthusiast currently pursuing a Bachelor of Arts in Computer Science at the University of California, Berkeley, with an expected graduation date in May 2025. My academic journey started at De Anza College, where I earned an Associate's in Computer Science for Transfer, accompanied by various accolades such as the VIDA and DASG Student Leadership Award 2023, DASG Scholarship, Community Engagement Scholar, Dean’s List, and Honor’s Program."
        },
        {
          id: "second-p-about",
          content:
            "My proficiency spans a range of programming languages, including Java, Python, C/C++, SQL, JavaScript, HTML/CSS, React, and Node.js. I am well-versed in developer tools and concepts, such as Data Structures and Algorithms, Git, and various libraries like Pandas, NumPy, Matplotlib, and TensorFlow. My experience extends to agile methodologies, software design, and collaborative work. I am fluent in English and Hindi, with a beginner-level proficiency in Spanish, I bring a multicultural perspective to my work."
        }
        // {
        //   id: "third-p-about",
        //   content:
        //     "Lorem ipsum pariatur consectetur laboris occaecat nulla aliqua irure ad deserunt duis. Eiusmod nulla cupidatat labore sint sit aute dolore irure nostrud ut incididunt. Anim laborum reprehenderit labore magna ut dolore quis irure. Labore ea duis deserunt ullamco irure fugiat deserunt ut nisi ea minim proident. Nisi consectetur do non magna duis aliqua minim minim veniam. In occaecat minim qui consequat elit mollit consectetur non id tempor. Amet adipisicing occaecat tempor culpa quis est duis."
        // }
      ]
    };
  }

  render() {
    return (
      <section id="about" className="about-mf sect-pt4 route">
        <div className="container">
          <div className="row">
            <div className="col-sm-12">
              <div className="box-shadow-full">
                <div className="row">
                  <div className="col-md-6">
                    <div className="row">
                      <div
                        className="col-sm-6 col-md-5"
                        style={{ margin: "0 auto" }}
                      >
                        <div
                          className="about-img"
                          style={{ textAlign: "center" }}
                        >
                          <img
                            className="img-fluid rounded b-shadow-a"
                            alt=""
                          />
                        </div>
                      </div>
                    </div>
                    <div className="skill-mf">
                      {/* <p className="title-s">Skill</p> */}
                      {this.state.skills.map(skill => {
                        return (
                          <React.Fragment key={skill.id}>
                            <span>{skill.content}</span>{" "}
                            <span className="pull-right">
                              {skill.porcentage}
                            </span>
                            <div className="progress">
                              <div
                                className="progress-bar"
                                role="progressbar"
                                style={{ width: skill.porcentage }}
                                aria-valuenow={skill.value}
                                aria-valuemin="0"
                                aria-valuemax="100"
                              ></div>
                            </div>
                          </React.Fragment>
                        );
                      })}
                    </div>
                  </div>
                  <div className="col-md-6">
                    <div className="about-me pt-4 pt-md-0">
                      <div className="title-box-2">
                        <h5 className="title-left">About Me</h5>
                      </div>
                      {this.state.about_me.map(content => {
                        return (
                          <p className="lead" key={content.id}>
                            {content.content}
                          </p>
                        );
                      })}
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}

export default About;
